import styles from './NavBar.module.scss'
import React from 'react';
import NavBar1 from './NavBar1';

const DesNav = () => (
  <div>
    <div className={styles.topFixed} >
      <div >

      </div>
      <div className={styles.sticky}>

        <NavBar1></NavBar1>
      </div>


    </div>

  </div>

)
export default DesNav;
